import {useState} from 'react';


const BoardForm = (props) => {

    const [title, setTitle] = useState();

    const body = {
        author: props.id,
        title: title,
        collaborators: []
    }

    console.log(body);

    return (
        <form>
         <label>
            Name:
             <input type="text" name="name" onChange={(e) => setTitle(e.target.value)}/>
        </label>
        <input type="submit" value="Submit" />
        </form>

    )

}

export default BoardForm;
